            if "_acc" in key:
                continue
            elif isinstance(dict_logs[key], dict):
                for sub_key in dict_logs[key].keys():
                    prefix = f"{key}"
                    if sub_key != "all":
                        if LoggingTypes.JSONL not in self.hparams.train_logging_per_dataset_info:
