def setup_terminal():

    if sys.platform == "win32":
        if msvcrt:
            return None  # Windows terminal is already configured
        logger.warning("msvcrt module not available on Windows")
        return None
    else:
        if termios and tty:
            try:
                fd = sys.stdin.fileno()
                old_settings = termios.tcgetattr(fd)
                tty.setraw(fd)
                return old_settings
            except (termios.error, AttributeError) as e:
