def perform_action(element: MacElementNode, action: str) -> bool:

	try:
		if not element._element:
			logger.error(f'âŒ Cannot perform action: Element reference is missing for {element}')
			return False

		# Check if the element supports this action
		available_actions = element.actions
		if action not in available_actions:
			logger.error(f'âŒ Action {action} not supported by element {element}. Available actions: {available_actions}')
			return False

		result = AXUIElementPerformAction(element._element, action)
		if result == 0:
			logger.debug(f'âœ… Successfully performed {action} on element: {element}')
			return True
		else:
			logger.error(f'âŒ Failed to perform {action} on element: {element}, error code: {result}')
			return False
	except Exception as e:
		logger.error(f'âŒ Error performing {action} on element: {element}, {e}')
		return False

