        if isinstance(data, dict):
            return [mid for mid in data.keys() if mid != 'sample_spec']
        models = []
        for entry in data:
            provider = entry.get("litellm_provider")
            model_name = entry.get("model")
            if provider and model_name and model_name != 'sample_spec':
