def replace_macrons_with_latex_overline(text: str) -> str:

    result = []
    for char in text:
        if char.isalpha():
            decomposed = unicodedata.normalize("NFD", char)
            if len(decomposed) > 1 and decomposed[1] == "\u0304":  # Macron accent
                result.append(f"\\overline{{{decomposed[0]}}}")
            else:
                result.append(char)
        elif char != "\u0304":
            result.append(char)
        else:
            result[-1] = f"\\overline{{{result[-1]}}}"

    return "".join(result)

def parse_directory(self, directory: Path) -> list[ParsedComponent]:

        components = []

        for file_path in directory.glob("**/*.py"):
            # Skip __pycache__ and other hidden directories
            if "__pycache__" in file_path.parts or any(
                part.startswith(".") for part in file_path.parts
            ):
                continue

            try:
                file_components = self.parse_file(file_path)
                components.extend(file_components)
            except Exception as e:
                relative_path = file_path.relative_to(self.project_root)
                console.print(
                    f"[bold red]Error parsing {relative_path}:[/bold red] {e}"
                )

        return components

