def fix_color_format(color: str) -> str:

    if not color:
        return ""

    color = color.strip().upper()
    if not color.startswith('#'):
        color = f"#{color}"

    color = color[1:]
    if len(color) == 3:
        r, g, b = color[0], color[1], color[2]
        return f"#{r}{r}{g}{g}{b}{b}"
    elif len(color) < 6:
        raise ValueError(f"Invalid color format: {color}")
    elif len(color) > 6:
        color = color[:6]

    return f"#{color}"

