def calculate_answer_score(answer_text, label, do_print=False, search_api=None, literature_type='trial', pub_date=None):

    try:
        data = json.loads(answer_text)
        pred_query = data["query"]

        searched_nctids = run_search_ctgov(pred_query, search_api)

        hit_pmids = set(searched_nctids) & set(label)
        recall = len(hit_pmids) / len(label)

        if do_print:
            print(f"Recall: {recall}")

        if recall >= 0.7:
            answer_score = 5
        elif recall >= 0.5:
            answer_score = 4
        elif recall >= 0.4:
            answer_score = 3
        elif recall >= 0.3:
            answer_score = 1
        elif recall >= 0.1:
            answer_score = 0.5
        elif recall >= 0.05:
            answer_score = 0.1
        else:
            answer_score = -3.5

    except:
        print("[Error] Error in evaluation")
        answer_score = -4

    return answer_score

