def _handle_streaming_response(self, response: requests.Response) -> Response:


        def generate():
            try:
                for chunk in response.iter_content(chunk_size=None):
                    if chunk:
                        yield chunk
            except Exception as e:
                logger.error(f"Error streaming response: {str(e)}", exc_info=True)
                yield json.dumps({"error": "An internal error has occurred."}).encode()

        response_headers = {
            "Content-Type": response.headers.get("Content-Type", "application/json")
        }

        return Response(
            stream_with_context(generate()),
            status=response.status_code,
            headers=response_headers,
        )

def from_otel(cls, code: Any | None) -> "StatusCode":

        if code is None:
            return cls.UNSET

        mapping = {"UNSET": cls.UNSET, "OK": cls.OK, "ERROR": cls.ERROR}

        if hasattr(code, "name"):
            return mapping.get(code.name, cls.UNSET)
        return cls.UNSET

